// Nav.js
import React from 'react';
import { Link } from 'react-router-dom';

const Nav = () => {
  return (
    <div className="nav-bar">
      <img className='logo' src={`${process.env.PUBLIC_URL}/vivian-source/logo.jpg`} alt="Logo" />
      <Link to="/">Trang Chủ</Link>
      <Link to="/roomview">Xem Phòng</Link>
      <Link to="/discover">Dịch Vụ</Link>
      <Link to="/contact">Liên Hêj</Link>
      <Link to="/book-room" className="book-link">Đặt Phòng</Link>
    </div>
  );
};

export default Nav;
